import logo from './logo.svg';
import './App.css';

function App() {
  const name = 'Matheus'
  return (
    <div className="App">
      <header className="App-header">
          <h1>Olá marilene</h1>
          <h2>Adicionando variaveis</h2>
          <p>Olá meu nome é: {name} </p>
      </header>
    </div>
  );
}

export default App;
